"use strict";var mongoose=require("mongoose");mongoose.pluralize(null);var doctorSchema=new mongoose.Schema({name:{type:String,required:!0},designation:{type:String,required:!0},institution:{type:String,required:!0},reg_number:{type:String,required:!0},mobile_no:{type:String,required:!0,unique:!0},email:{type:String,required:!0},password:{type:String,required:!0},session_token:{type:String,required:!1},image:{type:String,required:!1},referrer:{type:String,required:!0}});mongoose.model("doctor",doctorSchema);